INSERT INTO `tbl_halaman` (`id_halaman`, `isi_halaman`) VALUES
(1, '<p><strong>CARA PEMESANAN DAN PANDUAN BERBELANJA :</strong></p>\r\n<p>Melakukan pembelajaan lakukan dengan mudah dengan langkah berikut ini :</p>\r\n<p><br />1. PILIH PRODUK</p>\r\n<p>a. Pilih produk yang ingin dibeli dengan cara mencari melalui nama produk&nbsp;atau model di <em>search bar</em> atau memilih produk melalui halaman utama <em>(home).&nbsp;</em>Selain itu<em>&nbsp;</em>pemilihan dapat dilakukan pada menu kategori produk berdasarkan kategori&nbsp;produk.</p>\r\n<p>b. Pastikan produk yang dipilih telah sesuai item dan jumlahnya, serta produk telah masuk keranjang belanja.</p>\r\n<p>c. Lanjutkan pembelian dengan menekan tombol <em>checkout.</em></p>\r\n<p>d. Pembelian berhasil dilakukan dan lanjutkan dengan pembayaran.</p>\r\n<p><br />2. PEMBAYARAN</p>\r\n<p>a. Kami akan memproses pemesanan dengan menerbitkan konfirmasi order melalui email sekaligus invoice penagihan ke alamat penagihan yang telah diisi sesuai data saat pendaftaran.</p>\r\n<p>b. Pembayaran dilakukan sebelum barang dikirim</p>\r\n<p>Pembayaran pemesanan paling lambat kami terima 5 hari (5 x 24 jam) setelah pemesanan dilakukan, apabila melewati waktu 5 hari (5 x 24 jam) maka pemesanan kami anggap batal.<br />Pembayaran dilakukan dengan metode transfer antar rekening dan wajib dibayar lunas. Pembayaran&nbsp;dilakukan ke rekening kami di :</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bank BNI Cabang Ratu Plaza</strong><br /><strong>Atas Nama : PT.&nbsp;Anugrah Mitra Selaras</strong><br /><strong>Nomor Rekening : 070-077-0075</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bank Mandiri Cabang Bendungah Hilir</strong><br /><strong>Atas Nama : PT.&nbsp;Anugrah Mitra Selaras</strong><br /><strong>Nomor Rekening : 122-000-509-1122</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bank BCA Cab. Radio Dalam</strong><br /><strong>Atas/n : PT.&nbsp;Anugrah Mitra Selaras</strong><br /><strong>Nomor Rekening : 219-303-0033</strong></p>\r\n<p><br />3. PENGIRIMAN</p>\r\n<p>a. Kami akan mengirimkan barang sesuai pemesanan yang dilakukan setelah pembayaran dilakukan sesuai jumlah yang ditagihkan.</p>\r\n<p>b. Apabila terjadi perubahan produk (model lama discontinue diganti dengan model yang baru), kami akan menginformasikan sebelum pengiriman.</p>\r\n<p>c. Dalam pengiriman kami sertakan kartu garansi dan petunjuk penggunaan.</p>\r\n<p>d. Pemasangan alat dilakukan oleh teknisi kami yang dilengkapi dengan surat tugas dan berita acara pemasangan setelah selesai dan berfungsi dengan baik.</p>\r\n<p>e. Pelatihan penggunaan alat juga dilakukan oleh tenaga ahli kami yang dilengkapi dengan surat tugas dan berita acara pelatihan setelah pelatihan telah selesai.</p>'),
(2, '<p style="text-align: justify;">PT. &nbsp;Anugrah Mitra Selaras adalah &nbsp;perusahaan yang bergerak dibidang penjualan alat-alat kesehatan serta perlengkapan ataupun aksesoris pendukung kegiatan dibidang kesehatan. PT. &nbsp;Anugrah Mitra Selaras merupakan distributor resmi &nbsp;dari alat-alat sistem X-Ray yang memegang hak paten merek Dongmun dari Korea Selatan . PT. Anugrah Mitra Selaras didirikan pada tanggal 19 Februari Tahun 2000 dan memulai kegiatan komersial pada tahun 2001.</p>\n<p style="text-align: justify;">PT. Anugrah Mitra Selaras&nbsp;merupakan market leader dan trend setter penyedia alat kesehatan dan laboratorium di Indonesia. Komitmen kami untuk memasarkan produk-produk berkualitas dan layanan prima telah mendapat pengakuan dari berbagai lembaga/ instansi pemerintah dan swasta di Indonesia. Produk berkualitas dan layanan prima merupakan jargon kami untuk menghadapi persaingan di era globalisasi dewasa ini.</p>\n<p style="text-align: justify;">&nbsp;</p>\n<p><strong>Visi PT. Anugrah Mitra Selaras :</strong></p>\n<ul>\n<li>Menjadi distributor alat-alat kesehatan terpercaya di Indonesia</li>\n<li>Mengembangkan perusahaan dengan terus memperluas jaringan kantor dan layanan pemasaran di seluruh Indonesia</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>Misi PT. Anugrah Mitra Selaras :</strong></p>\n<ul>\n<li>Memberikan pelayanan yang terbaik kepada seluruh konsumen di Indonesia</li>\n<li>Memberikan pelayanan <em>&ldquo;One Stop Shopping&rdquo;</em> bagi kebutuhan alat-alat kesehatan</li>\n</ul>\n<p>&nbsp;</p>\n<p>Kami hadir lebih dekat dengan Anda untuk memberikan layanan bagi pelanggan setia kami melalui <em>online shop</em> ini&nbsp;dengan beragam varian produk dari merek ternama, yang tentu saja berkualitas demi memenuhi kebutuhan Anda.</p>\n<p>Dukungan sumber daya dan teknologi mutakhir, membuat belanja Anda semakin nyaman dan aman bersama kami.</p>'),
(3, '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="../../assets/images/logo2.png" alt="Logo PT. Anugrah Mitra Selaras" width="250" height="89" /></p>\r\n<p style="text-align: center;">Jl. Agung Niaga IV, RT. 014/RW. 013<br />Sunter Agung<br />Tanjung Priok<br />Kota Jakarta Utara<br />Daerah Khusus Ibukota Jakarta<br />Indonesia -&nbsp;14350</p>\r\n<p style="text-align: center;">&nbsp;</p>\r\n<p style="text-align: center;">E-mail: info@ams-medical.com<br />Telephone: +62-21-<a class="fl r-iN2n51uKC6CI" title="Telepon telepon via Hangouts" data-number="+62216406029" data-pstn-out-call-url="" data-rtid="iN2n51uKC6CI" data-ved="0ahUKEwie1pzygKPVAhVEkJQKHY9ODBoQkAgIjQEoADAU">6406029</a><br />Fax: +62-21-<a class="fl r-iN2n51uKC6CI" title="Telepon telepon via Hangouts" data-number="+62216406029" data-pstn-out-call-url="" data-rtid="iN2n51uKC6CI" data-ved="0ahUKEwie1pzygKPVAhVEkJQKHY9ODBoQkAgIjQEoADAU">6406028</a></p>'),
(4, '<p style="text-align: justify;"><strong>SYARAT DAN KETENTUAN</strong></p>\r\n<p style="text-align: justify;"><br />Pelanggan yang terhormat,</p>\r\n<p style="text-align: justify;">Selamat datang dan berbelanja di e-commerce ams-medical.com, berikut beberapa hal yang perlu kami informasikan dalam pembelanjaan di ams-medical.com. Harap dapat dipahami dan dimengerti ketentuan dan syarat yang kami berlakukan terkait hukum yang berlaku.<br /> <br />Seputar Penggunaan<br />Pengguna menyadari, memahami, menerima dan menyetujui persyaratan dan ketentuan yang ada dalam ams-medical.com. Dengan mengakses atau menggunakan situs ams-medical.com, dianggap telah memahami dan menyetujui semua isi dalam syarat dan ketentuan. Syarat dan ketentuan dapat diubah atau diperbaharui sewaktu-waktu tanpa ada pemberitahuan terlebih dahulu. Perubahan dari syarat dan ketentuan akan segera berlaku setelah dicantumkan di dalam situs ams-medical.com.</p>\r\n<p style="text-align: justify;">Ketentuan Penggunaan<br />Saat mengunjungi dan menggunakan ams-medical.com, termasuk setiap fitur dan layanannya, pengguna wajib untuk mematuhi ketentuan berikut ini:</p>\r\n<p style="text-align: justify;">1. Pembelian produk pada gjmshop.com tidak diperkenankan untuk digunakan dan atau di distribusikan diluar wilayah Indonesia.</p>\r\n<p style="text-align: justify;">2. Tidak diperkenankan untuk mereproduksi, mendistribusikan, memajang, menjual, menyewakan, mengirimkan, membuat karya turunan dari, menerjemahkan, memodifikasi, merekayasa balik, membongkar, mengurai atau mengeksploitasi situs ams-medical.com.</p>\r\n<p style="text-align: justify;">3. Tidak diperkenankan untuk memuat dan menerbitkan konten yang melanggar hak cipta, paten, merek dagang, merek layanan, rahasia dagang, atau hak kepemilikan lainnya.</p>\r\n<p style="text-align: justify;">4. Transaksi</p>\r\n<p style="text-align: justify;">Harga yang tertera belum termasuk Ongkos Kirim (tarif arrmada ataupun kurir).<br /> Untuk pembelian online, pesanan dan pengiriman akan diproses setelah pembayaran diterima oleh rekening bank atas nama PT. Anugrah Mitra Selaras. Lama waktu pengiriman disesuaikan dengan area layanan daerah tujuan. Untuk pengiriman produk selalu disertai asuransi untuk mencegah kehilangan atau kerusakan selama dalam perjalanan.<br />Setiap produk yang dibeli dari ams-medical.com dilengkapi dengan masa garansi yang dapat disesuaikan dengan kesepakatan lebih lanjut.<br />Barang yang telah dibeli tidak dapat dikembalikan atau ditukar dengan barang lain, kecuali ada perjanjian terlebih dahulu.<br />Jika dalam masa garansi, terjadi kerusakan pada barang, silakan menghubungi Technical Center kami di No. (021) 290-36364 atau email ke help@ams-medical.com.<br />5. Harga : Jika dalam keadaan tertentu, terdapat kesalahan harga ataupun informasi mengenai suatu produk tertentu yang disebabkan oleh kesalahan pengetikan (Typo) atau kesalahan harga dan informasi yang berasal dari supplier, ams-medical.com&nbsp;berhak untuk menolak ataupun membatalkan pesanan yang menggunakan harga yang salah termasuk pesanan yang sudah dibayarkan. Jika pesanan tersebut sudah dibayarkan, maka kami akan melakukan pengembalian dana sesuai dengan jumlah yang telah dibayarkan.</p>\r\n<p style="text-align: justify;">6. Ketersediaan Barang<br />Demi mempertahankan harga jual yang tetap kompetitif, sangat sukar bagi pihak kami untuk selalu menyediakan <em>(ready stock)</em> setiap produk yang kami tampilkan di ams-medical.com. Staff kami akan dengan senang hati mengkonfirmasikan kembali jika ada beberapa produk yang perlu dipesan serta lamanya waktu pemesanan. Kami percaya hanya dengan cara inilah, kami tetap bisa menjaga harga jual yang terbaik bagi pelanggan kami.</p>\r\n<p style="text-align: justify;">7. Pengguna Terdaftar&nbsp;<em>(Member)</em></p>\r\n<p style="text-align: justify;">Menjadi Pengguna Terdaftar (selanjutnya akan disebut sebagai "<em>member</em> ams-medical.com") tidak dipungut biaya / gratis.<br /> Dengan memilih untuk membuat akun sebagai pengguna dari situs ams-medical.com, pengguna ams-medical.com akan membuat sebuah nama akun dan <em>password</em> ketika menyelesaikan proses registrasi.<br /> Pengguna ams-medical.com bertanggung jawab untuk menjaga kerahasiaan dan keamanan atas nama akun dan password serta Pengguna Terdaftar bertanggung jawab sepenuhnya atas segala kegiatan yang diatasnamakan nama akun pengguna Terdaftar.<br /> Segera memberitahukan kepada Kami setiap adanya dugaan penggunaan yang tidak sah/ valid dengan pengatasnamaan nama akun Member Anda.<br /> Memastikan bahwa keluar <em>(log out)</em> dari akun pada setiap akhir dari aktivitas pada situs ams-medical.com untuk menghindari kemungkinan terjadinya penyalahgunaan atas akun yang bersangkutan.<br /> Kami berhak sepenuhnya untuk membatasi, memblokir atau mengakhiri pelayanan dari suatu akun, melarang akses ke situs ams-medical.com dan konten, layanan, dan memperlambat atau menghapus <em>hosted content</em>, dan mengambil langkah-langkah hukum untuk menjaga pengguna ams-medical.com atau pengguna lain jika Kami menganggap pengguna melanggar hukum-hukum yang berlaku, melanggar hak milik intelektual dari pihak terkait, atau melakukan suatu pelanggaran yang melanggar hal-hal yang tertera pada syarat dan ketentuan.<br /> Bahwa pengguna tidak diperkenankan menjual, berupaya menjual, menawarkan untuk menjual, memberikan, menyerahkan atau mengalihkan Akun, Identitas Pengguna atau Sandi kepada pihak ketiga tanpa sepengetahuan dan persetujuan tertulis sebelumnya dari Kami. Kami dapat menangguhkan atau menghentikan Akun pengguna dan Akun pihak yang menerima pengalihan dari pengguna yang dijual, ditawarkan untuk dijual, diberikan, diserahkan atau dialihkan. Apabila dengan keterbatasan kemampuan Kami dalam mengidentifikasi pelanggaran ini, maka seluruh akibat, resiko adalah merupakan tanggung jawab dari pengguna yang mengalihkan.</p>');
